import React from 'react';
import './Result.styles.css';
import { useSelector } from 'react-redux';


export default function Result({cardsNumber}) {
 const {totalMoves} = useSelector((state) => state.movesSlice)
 let prec
 console.log(cardsNumber);
 if(totalMoves !== 0 && totalMoves >= cardsNumber/2 ){
    prec= ( 1 - ((totalMoves-cardsNumber/2)/ totalMoves) )*100;
 }
  return (
    <div  className='result'>
        <div class="wrapper">
            <div id="bottom-bar">
                <div class="bottom-bar-element">
                    Total Moves: {totalMoves}
                </div>
                <div class="bottom-bar-element">
                    precentage:  {prec !== undefined ? prec : <span><i></i></span>}               
                </div>
                <div class="bottom-bar-element">
                    
                </div>
                <div class="bottom-bar-element">
                
                    
                </div>
            </div>
        </div>
    </div>
    )
}
